import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import LoginPage from "./pages/LoginPage/LoginPage"; // Importa la p치gina de login
import Dashboard from "./pages/Dashboard/Dashboard"; // Ejemplo de otra p치gina

function App() {
  return (
    <Router>
      <Routes>
        {/* Ruta para el Login */}
        <Route path="/login" element={<LoginPage />} />

        {/* Ruta para el Dashboard (u otra vista) */}


        {/* Ruta por defecto (redirige a login) */}
        <Route path="*" element={<LoginPage />} />
      </Routes>
    </Router>
  );
}

export default App;
